script: |
  super -f text -I q9885.spq | sort > q9885.out

inputs:
  - name: q9885.spq
    data: |
      SELECT col0 / 91 + 62 FROM tab0 (FORMAT parquet) WHERE NOT + 86 + col1 BETWEEN - col1 * - + ( + + col0 ) - - + 26 AND NULL;
  - name: tab0

outputs:
  - name: q9885.out
    data: |
      62
      62
      63
